	(11,'api','{\"dashboard\":\"Api Servis Merkezi\",\"dashboard_info\":\"Api Servis Merkezi - outsource json data\",\"api_top_info\":\"Api merkezinde sistem datalar\\u0131n\\u0131z\\u0131 outsource yapabilir ve bunlar\\u0131 y\\u00f6netebilirsiniz.Api servis kayna\\u011f\\u0131 default olarak json data sa\\u011flamaktad\\u0131r.Siz bu kaynaklar\\u0131 d\\u0131\\u015f paket\\n          y\\u00f6netimi vas\\u0131tas\\u0131yla outsource edebilir ve sisteminizi kullanan ba\\u011f\\u0131ml\\u0131 kullan\\u0131c\\u0131lar\\u0131 d\\u00fczenleyebilirsiniz.Api olu\\u015fturaca\\u011f\\u0131n\\u0131z sistem kullan\\u0131c\\u0131lar\\u0131,developer,coding ve quest mod\\n          olmak \\u00fczere 3 e ayr\\u0131lmaktad\\u0131r.Outsource yapaca\\u011f\\u0131n\\u0131z d\\u0131\\u015f kullan\\u0131c\\u0131lar\\u0131n\\u0131z quest modda datalar\\u0131n\\u0131z\\u0131 g\\u00f6r\\u00fcnt\\u00fcleyebilmektedir.\",\"api_top_info1\":\"Data g\\u00fcvenli\\u011fi ve loglama\",\"api_top_info2\":\"Data g\\u00fcvenli\\u011fi outsource sa\\u011flanan kullan\\u0131c\\u0131lar\\u0131n\\u0131z i\\u00e7in belirlenen header paketleriyle\\n          sa\\u011flanman\\u0131n yan\\u0131 s\\u0131ra ba\\u011f\\u0131ml\\u0131 kullan\\u0131c\\u0131lar\\u0131n\\u0131za static ip ve \\u015fifre talebi gerekmektedir.Bu \\u015fartlar\\u0131n sa\\u011flanmamas\\u0131 apinin hi\\u00e7 bir \\u015fekilde cevap vermemesine (response send)\\n          sebep olmaktad\\u0131r.B\\u00fct\\u00fcn api eri\\u015fimleri en detayl\\u0131 bir \\u015fekilde sistemde loglanmaktad\\u0131r.\",\"api_table_info\":\"Api Sa\\u011flanan Kullan\\u0131c\\u0131lar\",\"api_group\":\"Api Grubu\",\"daily_hash_number\":\"G\\u00fcnl\\u00fck Oturum Say\\u0131s\\u0131\",\"daily_hash_limit\":\"G\\u00fcnl\\u00fck Oturum Limiti\",\"access_services\":\"Eri\\u015fim Servisleri\",\"api_edit_page_title\":\"Api Kullan\\u0131c\\u0131 D\\u00fczenleme Sayfas\\u0131\",\"api_edit_page_info\":\"Api kullan\\u0131c\\u0131s\\u0131n\\u0131n t\\u00fcm api bilgi